import React, { Component } from 'react'
import Child from './Child'

export default class parent extends Component {

    // 如果生命周期中发生错误就会运行
    static getDeriveStateFromError(error) {
        console.log(error);
    }

    sum = () => {
        return 1 / 0 ; 
    }

    render() {
        return (
            <div>
                <h2>Parent组件</h2>
                <Child/>
                {this.sum}
            </div>
        )
    }
}
